  \"2016-05-20T00:45:02.990108\",\n\t\"name\": \"dixie-valley-engineered-geothermal-system-exploration-methodology-project-baseline-concept-1d64b\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Engineered Geothermal System (EGS) Exploration
  Methodology Project is developing an exploration approach for EGS through the integration
  of geoscientific data.  The Project chose the Dixie Valley Geothermal System in
  Nevada as a field laboratory site for methodlogy calibration purposes because, in
  the public domain, it is a highly characterized geothermal systems in the Basin
  and Range with a considerable amount of geoscience and most importantly, well data.
  \ This Baseline Conceptual Model report summarizes the results of the first three
  project tasks (1) collect and assess the existing public domain geoscience data,
  (2) design and populate a GIS database, and (3) develop a baseline (existing data)
  geothermal conceptual model, evaluate geostatistical relationships, and generate
  baseline, coupled EGS favorability/trust maps from +1km above sea level (asl) to
  -4km asl for the Calibration Area (Dixie Valley Geothermal Wellfield) to identify
  EGS drilling targets at a scale of 5km x 5km.  It presents (1) an assessment of
  the readily available public domain data and some proprietary data provided by Terra-Gen
  Power, LLC, (2) a re-interpretation of these data as required, (3) an exploratory
  geostatistical data analysis, (4) the baseline geothermal conceptual model, and
  (5) the EGS favorability/trust mapping.  The conceptual model presented applies
  to both the hydrothermal system and EGS in the Dixie Valley region. \",\n\t\"license_title\":
